import React from 'react';
import ProfileData from '../data/schoolProfiles.json';

function SchoolProfile(match) {
  console.log(match);

  return (
    <div>
      {ProfileData.filter((value,index,array)=>{
        return value.name === match;
      })}
    </div>
  );
}

export default SchoolProfile;
